## What do house cleaning services include?

House cleaning services cover all the areas of your house, deep cleaning of individual rooms or appliances, and related tasks. Whether you need someone to handle [spring cleaning](https://schmicnics.com.au/deep-cleaning-canberra) or an expert who can make your home spotless after you [move out](https://schmicnics.com.au/end-of-lease-cleaning-canberra), We are ready to help you. We will bring our equipment and cleaning solutions when accomplishing a job, though you can ask them to use what you have at home.

### Cleaning the bathroom

Professional house cleaning usually starts in the most labour-intensive room: the bathroom. This tiny space has a lot of different surfaces and kinds of dirt that will need to be scrubbed out, like tile grout and water deposits on showerheads.

We usually clean the ceilings and walls, scrub the tiles, wipe down countertops and cabinets, and clean any mats or rugs. We also clean the shower, toilet, and bathtub, getting rid of any unsightly stains. We also polish faucets and mirrors and dispose of the trash. We can also change the towels for you, upon request.

### Cleaning the living room and common areas

The service usually involves the living room and other common areas you may have, such as hallways and the dining room. Cleaners sweep the cobwebs and any ceiling dust, then wipe down all exposed surfaces, such as couches, tables, and shelves. Any mirrors, picture frames, and other decorations will also be dusted. They also sweep, mop, and vacuum the floors, then clean out your wastebaskets.

### Cleaning the bedrooms

Similar to cleaning the living room and common areas, house cleaners wipe down surfaces, clean the fixtures and embellishments, and sanitise the floor. To save more time, you can also have our cleaner change the bed linen and handle the laundry.

### Cleaning the kitchen

You can expect our cleaner to clean your kitchen’s ceiling, walls, and floor. They also wipe the exteriors of appliances, such as your range and dishwasher. This service also covers dusting your tables and chairs, cleaning any items on display, cleaning your sink and drip pans, and disposing of your trash. Cleaners usually include shining your faucets and fixtures as part of the kitchen cleaning checklist.

